  \"2015-09-26T19:35:36.414609\",\n\t\"name\": \"partial-pressure-or-fugacity-of-carbon-dioxide-dissolved-inorganic-carbon-ph-temperature-salini\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113533 includes chemical,
  discrete sample, physical and profile data collected from DISCOVERY in the North
  Atlantic Ocean from 1990-04-25 to 1990-04-29 and retrieved during cruise CARINA/74DI19900425.
  These data include DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
  NITRATE, NITRITE, PHOSPHATE, Partial pressure (or fugacity) of carbon dioxide, Potential
  temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE and pH. The instruments
  used to collect these data include CTD and bottle. These data were collected by
  Andrew Watson of Plymouth Marine Laboratory as part of the CARINA/74DI19900425 data
  set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project is
  an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
  It has produced a merged internally consistent data set of open ocean subsurface
  measurements for biogeochemical investigations, in particular, studies involving
  the carbon system. The original focus area was the North Atlantic Ocean, but over
  time the geographic extent expanded and CARINA now includes data from the entire
  Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"license_title\": null,\n\t\"extras\":
